              }}></path></svg></span>{`important`}</h5></div><div parentName="div" {...{
        "className": "admonition-content"
      }}><p parentName="div">{`ElastiCache Redis caches cannot be accessed from outside the VPC, as they don’t have public IP addresses assigned to them.If you want to work with ElastiCache Redis caches with RedisInsight, you can either setup an SSH tunnel between RedisInsight and your Elasticache instance, in case you're not using Redis Cluster.`}</p></div></div>
    <p>{`This tutorial shows how to:`}</p>
    <ul>
      <li parentName="ul">{`Setup and configure Amazon Elasticache`}</li>
      <li parentName="ul">{`Configure the VPC`}</li>
      <li parentName="ul">{`Configuring the security groups`}</li>
      <li parentName="ul">{`Configure and setup Amazon EC2`}</li>
      <li parentName="ul">{`Create and configure IAM role`}</li>
      <li parentName="ul">{`Assign the permissions`}</li>
      <li parentName="ul">{`Connect to Elasticache from EC2 instance`}</li>
      <li parentName="ul">{`Setup RedisInsight`}</li>
      <li parentName="ul">{`Access RedisInsight`}</li>
      <li parentName="ul">{`Autodiscover Elasticache Instance`}</li>
    </ul>
    <h3 {...{
      "id": "step-1-setup-and-configure-amazon-elasticache"
    }}>{`Step 1. Setup and configure Amazon Elasticache`}</h3>
    <p>{`Login to `}<a parentName="p" {...{
        "href": "https://aws.amazon.com"
      }}>{`AWS Management Console`}</a>{` and click "Get Started now"`}</p>
    <p><img alt={"elasticache"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image1.png").default} /></p>
    <p>{`Choose "Redis" as the cluster engine`}</p>
    <p><img alt={"elasticache"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image2.png").default} /></p>
    <p>{`Configure Redis settings:`}</p>
    <p><img alt={"elasticache"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image3.png").default} /></p>
    <p>{`Copy and save the Elasticache primary endpoint URL:`}</p>
    <p><img alt={"elasticache"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image5.png").default} /></p>
    <h3 {...{
      "id": "step-2-configure-the-vpc"
    }}>{`Step 2. Configure the VPC`}</h3>
    <p>{`Configure and chose VPC that has your ElastiCache instances`}</p>
    <p><img alt={"elasticache"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image6.png").default} /></p>
    <h3 {...{
      "id": "step-3-configure-the-security-groups"
    }}>{`Step 3. Configure the Security Groups`}</h3>
    <p><img alt={"elasticache"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image7.png").default} /></p>
    <p>{`Configure inbound and outbound rules to allow RedisInsight and Redis ports:`}</p>
    <p><img alt={"elasticache"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image12.png").default} /></p>
    <h3 {...{
      "id": "step-4-configure-and-setup-amazon-ec2"
    }}>{`Step 4. Configure and setup Amazon EC2`}</h3>
    <p><img alt={"elasticache"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image8.png").default} /></p>
    <h3 {...{
      "id": "step-5-create-and-configure-iam-role"
    }}>{`Step 5. Create and configure IAM role`}</h3>
    <p>{`You can use the AWS Management Console to create a role that an IAM user can assume`}</p>
    <p><img alt={"elasticache"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image9.png").default} /></p>
    <p>{`Under Select type of trusted entity, choose EC2. In other words, the role is used by an EC2 instance`}</p>
    <p><img alt={"elasticache"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image10.png").default} /></p>
    <p>{`Click “Next”.`}</p>
    <h3 {...{
      "id": "step-6-assign-the-permissions"
    }}>{`Step 6. Assign the permissions`}</h3>
    <p>{`Assign the below permissions:`}</p>
    <ul>
      <li parentName="ul">{`AmazonS3ReadOnlyAccess`}</li>
      <li parentName="ul">{`AmazonElastiCacheReadOnlyAccess`}</li>
    </ul>
    <p><img alt={"elasticache"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image11.png").default} /></p>
    <h3 {...{
      "id": "step-7-connect-to-elasticache-from-ec2-instance"
    }}>{`Step 7. Connect to Elasticache from EC2 instance`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` ubuntu@ip-10-0-0-254:~$ redis-cli -h redisinsightdemo.8cfnjo.ng.0001.use1.cache.amazonaws.com -p 6379
 redisinsightdemo.8cfnjo.ng.0001.use1.cache.amazonaws.com:6379>
`}</code></pre>
    <h3 {...{
      "id": "step-8-setup-redisinsight"
