    <p><img alt={"elasticache"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image13.png").default} />{`
`}<img alt={"elasticache"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image14.png").default} /></p>
