              }}></path></svg></span>{`important`}</h5></div><div parentName="div" {...{
        "className": "admonition-content"
      }}><p parentName="div">{`In case you encounter the below error message:`}</p><p parentName="div">{`This EC2 instance does not have permissions to discover your ElastiCache instances. To grant permission, create an IAM role  with the DescribeCacheClusters permission and attach the role  to this EC2 instance.`}</p><p parentName="div">{`You might have to attach IAM role to the instance as shown below:`}</p><p parentName="div"><img alt={"elasticache"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image15.png").default} /></p></div></div>
    <p>{`Now you can should be able to autodiscover Elasticache`}</p>
    <p><img alt={"elasticache"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image16.png").default} /></p>
    <p><img alt={"elasticache"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image18.png").default} /></p>
    <p>{`Add the selected instance:`}</p>
    <p><img alt={"elasticache"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image19.png").default} /></p>
    <p>{`Add the discovered instance:`}</p>
    <p><img alt={"elasticache"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image20.png").default} /></p>
    <h3 {...{
      "id": "references"
    }}>{`References`}</h3>
    <ul>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/explore/redisinsight/browser"
